import React from 'react';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  return (
    <footer className="bg-gray-900 text-white py-6 text-center">
      <p>&copy; {currentYear} Vishesh Panchal. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
